import Nbar from "./NavxFooter/NavBar";
const NotFound = () => {
    return(
        <div className=" bg-cover bg-full bg-center" style={{ backgroundImage: `url(not.jpg)` }}>

            <Nbar />
       <h1 className="text-7xl mt-36 ml-20 red font-bold text-yellow-50  ">Page Not Found </h1>
       <h1 className="text-5xl mt-2 ml-20 font-thin  text-red-100">404 </h1>
       <button type="button" class="text-white mt-60 bg-gradient-to-br from-pink-500 to-orange-400 hover:bg-gradient-to-bl focus:ring-4 focus:outline-none focus:ring-pink-200 dark:focus:ring-pink-800 font-medium rounded-lg text-sm px-5 py-2.5 text-center mr-2 mb-2">Go back Home</button>
      
        </div>
       
    );
};
export default NotFound;
